import React, { useRef } from 'react'
import { useGLTF, useAnimations } from '@react-three/drei'

export default function Model(props) {
  const group = useRef()
  const { nodes, materials, animations } = useGLTF('/Ethereum/Ethereum.gltf')
  return (
    <group ref={group} {...props} dispose={null}>
      <group name="Scene">
        <mesh name="Ethereum" geometry={nodes.Ethereum.geometry} material={materials['Material.006']} position={[0, 1.21, 0]} rotation={[0, 1.15, 0]} scale={[0.51, 0.01, 0.51]} />
      </group>
    </group>
  )
}

useGLTF.preload('/Ethereum/Ethereum.gltf')
